import React from 'react';
import Image from 'react-bootstrap/Image';
import { IoLogoWhatsapp } from 'react-icons/io';
import { AiFillTwitterCircle, AiFillInstagram, AiFillYoutube } from 'react-icons/ai';
import { RiFacebookCircleFill } from 'react-icons/ri';
import { Container, Row, Col } from 'reactstrap';

const Header = () => {
    return (
        <nav>
            <div className="nav nav-tabs">
                <Container>
                    <Row>
                        <Col xs lg="2">
                            <Image
                                style={{ paddingTop: "20px", paddingBottom: "10px" }}
                                src="http://www.agerba.ba.gov.br/themes/custom/secom/image/logo.png" width="200px" height="90px"
                            />

                        </Col>
                        <Col></Col>
                        <Col md="auto"
                            style={{ paddingTop: "20px", paddingBottom: "10px" }}
                            className="Container text-center">
                            <h1>
                                <a href="#" title="Facebook" style={{ color: 'grey' }}><RiFacebookCircleFill size={55} /></a>
                                <a href="#" title="Twitter" style={{ color: 'grey' }}><AiFillTwitterCircle size={50} /></a>
                                <a href="#" title="Instagram" style={{ color: 'grey' }}><AiFillInstagram size={55} /></a>
                                <a href="#" title="WhatsApp" style={{ color: 'grey' }}><IoLogoWhatsapp size={50} /></a>
                                <a href="#" title="Youtube" style={{ color: 'grey' }}><AiFillYoutube size={65} /></a>
                            </h1>
                        </Col>
                    </Row>
                </Container>
            </div>
        </nav>
    );
};

export default Header;
